-- ----------------------------
-- View structure for v_mytasklist
-- ----------------------------
DROP VIEW IF EXISTS `v_mytasklist`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `v_mytasklist` AS select `rt`.`EXECUTION_ID_` AS `executionId`,`rt`.`ASSIGNEE_` AS `assignee`,'' AS `groupId`,`rt`.`NAME_` AS `taskName`,`rt`.`ID_` AS `taskId`,'0' AS `claimStatus`,`rt`.`SUSPENSION_STATE_` AS `suspensionStatus`,`sai`.`id` AS `id`,`sai`.`proc_def_id` AS `procDefId`,`sai`.`proc_inst_id` AS `procInstId`,`sai`.`is_end` AS `isEnd`,`sai`.`apply_type` AS `applyType`,`sai`.`apply_user_code` AS `applyUserCode`,`sai`.`vo_clazz` AS `voClazz`,`sai`.`valid_ind` AS `validInd`,`sai`.`create_time` AS `createTime`,`sai`.`creator_code` AS `creatorCode`,`sai`.`update_time` AS `updateTime`,`sai`.`updater_code` AS `updaterCode` from (`sys_apply_info` `sai` left join `act_ru_task` `rt` on((`sai`.`proc_inst_id` = `rt`.`PROC_INST_ID_`))) where ((`sai`.`is_end` = false) and (`rt`.`ASSIGNEE_` is not null)) union all select `rt`.`EXECUTION_ID_` AS `executionId`,`i`.`USER_ID_` AS `assignee`,`i`.`GROUP_ID_` AS `groupId`,`rt`.`NAME_` AS `taskName`,`rt`.`ID_` AS `taskId`,'1' AS `claimStatus`,`rt`.`SUSPENSION_STATE_` AS `suspensionStatus`,`sai`.`id` AS `id`,`sai`.`proc_def_id` AS `procDefId`,`sai`.`proc_inst_id` AS `procInstId`,`sai`.`is_end` AS `isEnd`,`sai`.`apply_type` AS `applyType`,`sai`.`apply_user_code` AS `applyUserCode`,`sai`.`vo_clazz` AS `voClazz`,`sai`.`valid_ind` AS `validInd`,`sai`.`create_time` AS `createTime`,`sai`.`creator_code` AS `creatorCode`,`sai`.`update_time` AS `updateTime`,`sai`.`updater_code` AS `updaterCode` from ((`sys_apply_info` `sai` left join `act_ru_task` `rt` on((`sai`.`proc_inst_id` = `rt`.`PROC_INST_ID_`))) left join `act_ru_identitylink` `i` on((`i`.`TASK_ID_` = `rt`.`ID_`))) where ((`sai`.`is_end` = false) and (`rt`.`ASSIGNEE_` is null) and (`i`.`TYPE_` = 'candidate'));

-- ----------------------------
-- Procedure structure for pro_column_work
-- ----------------------------
DROP PROCEDURE IF EXISTS `pro_column_work`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pro_column_work`(ctype int,tablename varchar(50), columnname varchar(50), sqlstr varchar(400),coldesc varchar(300))
begin
    declare rows1 int;
    set rows1 = 0;
    select count(*)
    into rows1
    from information_schema.columns
    where table_schema = database()
      and table_name = tablename
      and column_name = columnname;
-- 
    if (ctype = 1 and rows1 <= 0) then
        set sqlstr := concat( 'alter table ',tablename,' add column ',columnname,' ',sqlstr,' comment ''',coldesc,'''');
-- 
    elseif (ctype = 2 and rows1 > 0) then
        set sqlstr := concat('alter table ', tablename, ' modify column ', columnname, ' ', sqlstr,' comment ''',coldesc,'''');
-- 
    elseif (ctype = 3 and rows1 > 0) then
        set sqlstr := concat('alter table  ', tablename, ' drop column  ', columnname);
    else
        set sqlstr := '';
    end if;
-- 
    if (sqlstr <> '') then
        set @sql1 = sqlstr;
        prepare stmt1 from @sql1;
        execute stmt1;
    end if;
    end
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
